import React,{Component} from 'react';
import Menu from '../menu/menu';
import './a'

class Answers extends Component{
    render(){
        return(
            <div>
            <Menu />
       <center><h1 className="answerComp">Answers Component</h1></center>
         </div>
        )
    }
}
export default Answers;
